text:
The first AstraZeneca jabs have been given to Tamworth Hospital's frontline workers. 

The rollout comes one week after the same injection was delivered to multiple GP clinics across the city.

@BellaEvansNBN https://t.co/CaYawmzfp2

The COVID vaccine rollout is underway on the Central Coast - with a new clinic opening at Erina. 

It aims to provide more than 1,500 Astra Zeneca jabs each week. 

@SkaieHull https://t.co/2BcWXASyPZ
